import React, { Component } from 'react';
import ReactDom from 'react-dom';
import { Carousel, Item, Caption, Card, Col, Figure,Button } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.css';

import '../node_modules/bootstrap/dist/css/bootstrap.min.css'




export default class Vehicales_card extends Component {

    render() {
        return (<div>
            <Card className="col-12 col-md-6 col-lg-3">
                <Card.Img variant="top" src={process.env.PUBLIC_URL+"tata_sumo.jpg"} />
                <Card.Body>
                    <Card.Title>Tata Sumo</Card.Title>
                    <Card.Text>


                    </Card.Text>
                    <Button variant="primary" className="btn btn-sm">Detail</Button>
                </Card.Body>
            </Card>

        </div>)
    }
}
